function App() {
  const [open, setOpen] = React.useState(false);

  const toggleOpen = () => {
    setOpen(!open);
  };

  return (
    <div className="div">
      <button className="open" onClick={toggleOpen}>
        Open CODE
      </button>
      {open &&
        videos.map((video) => (
          <div key={video.id}>
            <h3>{video.name}</h3>
            <p>Duration: {video.duration}</p>
          </div>
        ))}
    </div>
  );
}

export default App;
